import React from 'react';
import "./experience-list.css";
import { Card_item } from '../experience/experience.component'

export const CardList = props => (
    <div>
        {props.classlist.map(classwork => (
        <Card_item
        key = {classwork.id} 
        class_name ={classwork.classname}
        class_description = {classwork.description}
        class_status = {classwork.status}/>
        ))}
    </div>




);
